"title": "215_24 Specialist Vehicles (outright purchase)",
"description": "Renewal of a national framework for the outright purchase of a wide range of specialist vehicles. The framework is intended to meet the requirements of local authorities and other eligible public sector organisations.rnrnLot 1 - Refuse collection vehicles (RCV's)rnLot 2 - Compact sweepersrnLot 3 - Chassis mounted sweepersrnLot 4 - Winter maintenance vehicles (inc' demountables)rnLot 5 - Gully emptiersrnLot 6 - Minibuses (inc' converted minibuses)rnLot 7 - Minibuses under 3.5t (inc' converted minibuses)rnLot 8 - Buses and coachesrnLot 9 - Customised vehicles (eg. mobile libraries)rnLot 10 - Chassis/cabsrnLot 11 - TippersrnLot 12 - Blue light (pumping, aerial & special appliances)rnLot 13 - Hot boxesrnLot 14 - Skip loadersrnLot 15 - Hook loadersrnrnESPO shall obtain a credit score (determined by the use of a credit rating agency) for each Supplier on or before the Framework start date as a base score and where a significant change in the credit score is identified over the life of the Framework (or the credit score goes below 30), ESPO reserves the right to investigate the reasons for this significant change. Depending on the severity of the changes, it will be at the sole discretion of ESPO to suspend or even permanently remove the awarded Supplier from the Framework.rnrnAdditional information: As a Central Purchasing Body as defined in the Public Contracts Regulations 2015, the Framework Agreement is open for use by Public Bodies (defined at https://www.espo.org/amfile/file/download/file/9608/) that also fall into one of the following classifications of user throughout all administrative regions of the UK: Local Authorities; Educational Establishments (including Academies); Central Government Departments and Agencies; Police, Fire & Rescue and Coastguard Emergency Services; NHS and HSC Bodies, including Ambulance Services; Registered Charities; Registered Social Landlords; The Corporate Office of the House of Lords, The Corporate Officer of the House of Commons; or any public body established by or under the Scotland Act 1998 or any Act of the Scottish Parliament. Details of the classification of end user establishments and geographical areas are available at: https://www.espo.org/legal.rnrnESPO has established a commercial trading company, ESPO Trading Limited, whose target clients are third sector organisations such as national and local charities, public sector mutual organisations and other organisations involved in the delivery of services to or for the public sector. The successful Supplier may be asked to enter into an additional separate framework agreement (the Second Framework) with ESPO Trading Limited on materially similar terms to that found in the tender pack to be entered into by ESPO itself.rnrnAny Second Framework agreement will be a purely commercial agreement and will, for the avoidance of doubt, not be governed by the Public Contract Regulations 2015 or other public procurement legislation. ESPO Trading Limited may enter into the second framework agreement with the successful supplier and make it available to third sector clients who themselves are not required to follow the Public Contracts Regulations 2015 or other public procurement legislation. Accordingly, this is provided for bidders information only.rnrnAn eAuction process may be used to award subsequent call off contracts following the reopening of competition among the parties to the Framework Agreement.",
